import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React from 'react';
import Slider from "react-slick";
import new_player_icon from './new_players_icon.webp'


export default function PlayerCarousel() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };

    return (
      <Slider {...settings}>
        <div>
            <div class="tile">
              <img src={new_player_icon}></img>
              <h4>Registered Players. </h4>
              <p > # of Registerd Players. </p>
            </div>

            <div class="tile">
              <h4>All Players</h4>
              <p > # of All Players</p>
            </div>

        </div>

        <div>
          <div class="tile">
            <h4>Commisions For yesterday</h4> 
            <p >$$$ </p>
          </div>

          <div class="tile">
            <h4>Current Month</h4> 
            <p >$$$ </p>
          </div>

        </div>
      </Slider>
    );
  }
